    Cyber Spaghetti
    This experiment is part of the Pins and Curves project.
    Read more: https://pinsandcurves.app

    This is an early beta. It is not stable.

    How to render:
    - Toggle 'g' to remove GUI in preview panel (otherwise handles are rendered). 
