//  ----------------------------------------------------------

const offset = 15;
const number_of_lines = 50;
const line_width = 3;
const colors = ["#d2ff9e","#9eedff","#f09eff","#ffcd9e"];
const background_color = "#10071c";
const primary_glow = 1;
const background_glow = 20;
const flicker_speed = 3;


//  ----------------------------------------------------------
/*

    Anything below this point is code not meant to be adjusted.

*/

let curveA, curveB;
let guiVisible = true;
let activeHandle = null;
const handleRadius = 15;

// GUI elements

let trimALabelStart, trimASliderStart, trimALabelEnd, trimASliderEnd;
let trimBLabelStart, trimBSliderStart, trimBLabelEnd, trimBSliderEnd;

let initialised = false;
let pg;

const cD = 1000;
let canvas;
function setup() {
  canvas = createCanvas(cD,cD);
  canvas.canvas.style.height = "100vh";
  canvas.canvas.style.width = "auto";
  pg = createGraphics(cD,cD);
  noiseSeed(1);


  // initialize control curves
  curveA = {
    start: createVector(100, height * 0.3),
    ctrl1: createVector(width * 0.3, height * 0.1),
    ctrl2: createVector(width * 0.6, height * 0.5),
    end:   createVector(width - 100, height * 0.3)
  };
  curveB = {
    start: createVector(100, height * 0.7),
    ctrl1: createVector(width * 0.3, height * 0.9),
    ctrl2: createVector(width * 0.6, height * 0.5),
    end:   createVector(width - 100, height * 0.7)
  };


}

function draw() {
        background(background_color);
    noFill();

    const propsValue = signal("Props");
    if (typeof propsValue === "string" 
        && propsValue !== "null"
        && initialised === false
       ) {
        const {curveA : ca,curveB:cb} = JSON.parse(propsValue);
        curveA.start= createVector(ca.start.x,ca.start.y)
        curveA.ctrl1= createVector(ca.ctrl1.x,ca.ctrl1.y)
        curveA.ctrl2= createVector(ca.ctrl2.x,ca.ctrl2.y)
        curveA.end= createVector(ca.end.x,ca.end.y)
        curveB.start = createVector(cb.start.x,cb.start.y)
        curveB.ctrl1 = createVector(cb.ctrl1.x,cb.ctrl1.y)
        curveB.ctrl2 = createVector(cb.ctrl2.x,cb.ctrl2.y)
        curveB.end = createVector(cb.end.x,cb.end.y)
        initialised = true;

    }

    // read GUI parameters
    const n = number_of_lines;
    const currentFrame = playhead();
    const trimA0 = signal("Trim Start");
    const trimA1 = signal("Trim End");
    const offsetFrame = Math.max(currentFrame - offset,0);
    const trimB0 = signal("Trim Start",offsetFrame);
    const trimB1 = signal("Trim End",offsetFrame);

    // draw base control curves
    if (guiVisible) {
          strokeWeight(3);
          stroke(255, 0, 0);
          drawRawBezier(curveA);
          stroke(0, 0, 255);
          drawRawBezier(curveB);
    }

    const alphaScale = 1000;
    const noiseVal = (v) => noise(v);
    const flickerScale = lerp(0.001, 0.1, flicker_speed / 10);

    // draw morphed & trimmed intermediate curves glow
    pg.clear();
    pg.noFill();
    for (let i = 0; i < n; i++) {
        const t = constrain(i / (n-1), 0, 1);
        const h_i = hash(i);
        const m = interpolateMorphedBezierCurve(curveA, curveB, t);
        const j = constrain(i / (n-1) + (h_i * 0.3 - 0.15),0,1);
        const startT = lerp(trimA0, trimB0, j);
        const endT   = lerp(trimA1, trimB1, j);
        const seg = trimBezierCurve(m, startT, endT);
        const col = colors[floor(h_i * colors.length)] 
        const weightOffset = h_i * line_width - line_width / 2
        pg.strokeWeight(line_width * 1.5 + weightOffset * 1.5);
        pg.stroke(col);
        //pg.setAlpha(noiseVal(i*colorVarScale));
        const alphaVal = constrain(noiseVal((currentFrame * flickerScale) + h_i * n),0,0.8)
        pg.drawingContext.globalAlpha = alphaVal
        drawRawBezier(seg,pg);
    }
    push();
    drawingContext.filter = `blur(${background_glow}px)`
    image(pg,0,0)
    pop();

    // draw morphed & trimmed intermediate curves glow
    pg.clear();
    pg.noFill();
    for (let i = 0; i < n; i++) {
        const t = constrain(i / (n-1), 0, 1);
        const h_i = hash(i);
        const m = interpolateMorphedBezierCurve(curveA, curveB, t);
        const j = constrain(i / (n-1) + (h_i * 0.3 - 0.15),0,1);
        const startT = lerp(trimA0, trimB0, j);
        const endT   = lerp(trimA1, trimB1, j);
        const seg = trimBezierCurve(m, startT, endT);
        const col = colors[floor(h_i * colors.length)] 
        const weightOffset = h_i * line_width - line_width / 2
        pg.strokeWeight(line_width + weightOffset);
        pg.stroke(col);
        //pg.setAlpha(noiseVal(i*colorVarScale));
        const alphaVal = constrain(noiseVal((currentFrame * flickerScale) + h_i * n),0,0.8)
        pg.drawingContext.globalAlpha = alphaVal
        drawRawBezier(seg,pg);
    }
    push();
    drawingContext.filter = `brightness(150%) blur(${primary_glow}px)`
    image(pg,0,0)
    pop();



    // draw handles & toggle hint
    if (guiVisible) {
    drawHandles(curveA, 'red');
    drawHandles(curveB, 'blue');
    strokeWeight(2);
    stroke(0)
    fill(255);
    textSize(20);
    text("Press 'G' to toggle GUI", 10, height - 10);
    }

}

function keyPressed() {
  if (key === 'g' || key === 'G') {
    guiVisible = !guiVisible;
    [
    ].forEach(el => guiVisible ? el.show() : el.hide());
    activeHandle = null;
  }
}

function mousePressed() {
  if (!guiVisible) return;
  activeHandle = findHandleUnderMouse(curveA) || findHandleUnderMouse(curveB);
}

function mouseDragged() {
  if (!guiVisible || !activeHandle) return;
  const x = constrain(mouseX, handleRadius, width - handleRadius);
  const y = constrain(mouseY, handleRadius, height - handleRadius);
  activeHandle.point.set(x, y);
}

function mouseReleased() {
  activeHandle = null;
  client.c.projectTools.updateSignalDefaultValue("cyberSpaghettiProps", 
     JSON.stringify({curveA,curveB}))
}

function findHandleUnderMouse(curve) {
  for (let key of ['start','ctrl1','ctrl2','end']) {
    const pt = curve[key];
    if (dist(mouseX, mouseY, pt.x, pt.y) < handleRadius) {
      return { curve, key, point: pt };
    }
  }
  return null;
}


function drawHandles(curve, col) {
  stroke(col);
  fill(255);
  // endpoints
  ['start','end'].forEach(key => {
    const p = curve[key];
    strokeWeight(2);
    ellipse(p.x, p.y, handleRadius * 2);
  });
  // control points & lines
  strokeWeight(1);
  fill(col);
  ['ctrl1','ctrl2'].forEach(key => {
    const p = curve[key];
    ellipse(p.x, p.y, handleRadius * 2);
    const anchor = (key === 'ctrl1') ? curve.start : curve.end;
    line(anchor.x, anchor.y, p.x, p.y);
    //noFill();
  });
}

function drawRawBezier(c,graphics) {
  if (graphics) {
        graphics.beginShape();
        graphics.vertex(c.start.x, c.start.y);
        graphics.bezierVertex(
          c.ctrl1.x, c.ctrl1.y,
          c.ctrl2.x, c.ctrl2.y,
          c.end.x,   c.end.y
        );
      graphics.endShape();
  } else {
    beginShape();
    vertex(c.start.x, c.start.y);
    bezierVertex(
      c.ctrl1.x, c.ctrl1.y,
      c.ctrl2.x, c.ctrl2.y,
      c.end.x,   c.end.y
    );
      endShape();
  }
}

function interpolateMorphedBezierCurve(a, b, t) {
  return {
    start: p5.Vector.lerp(a.start, b.start, t),
    ctrl1: p5.Vector.lerp(a.ctrl1, b.ctrl1, t),
    ctrl2: p5.Vector.lerp(a.ctrl2, b.ctrl2, t),
    end:   p5.Vector.lerp(a.end,   b.end,   t)
  };
}

function splitBezierCurve(curve, t) {
  const p0 = curve.start.copy(),
        p1 = curve.ctrl1.copy(),
        p2 = curve.ctrl2.copy(),
        p3 = curve.end.copy();

  const p01  = p5.Vector.lerp(p0, p1, t),
        p12  = p5.Vector.lerp(p1, p2, t),
        p23  = p5.Vector.lerp(p2, p3, t),
        p012 = p5.Vector.lerp(p01, p12, t),
        p123 = p5.Vector.lerp(p12, p23, t),
        p0123 = p5.Vector.lerp(p012, p123, t);

  return [
    { start: p0, ctrl1: p01,   ctrl2: p012,  end: p0123.copy() },
    { start: p0123.copy(), ctrl1: p123, ctrl2: p23,    end: p3 }
  ];
}

function trimBezierCurve(curve, t0, t1) {
  const [left] = splitBezierCurve(curve, t1);
  const localT = t0 / t1;
  const [, segment] = splitBezierCurve(left, localT);
  return segment;
}


function playhead() {
try {
  return client.playhead();
} catch (e) {
  return 0;
}
};

function hash(i) {
    return fract(Math.sin(i*999.999) * 10000);
}
